import axios from 'axios';

const API_KEY = 'caf460abe7d9fc4919ce6461';
const BASE_URL = 'https://v6.exchangerate-api.com/v6';

class ServicoDeCambio {
  static obterMoedas() {
    return axios.get(`${BASE_URL}/${API_KEY}/latest/USD`);
  }

  static converterMoeda(moedaDe, moedaPara) {
    return axios.get(`${BASE_URL}/${API_KEY}/latest/${moedaDe}`);
  }
}

export default ServicoDeCambio;
